import {
  Route,
  createBrowserRouter,
  createRoutesFromElements,
} from "react-router-dom";
import "./App.css";
import MainLayout from "./pages/MainLayout";
import NotFound from "./component/NotFound";

const router = createBrowserRouter(
  createRoutesFromElements(
    <Route
      path="/"
      element={<MainLayout />}
      errorElement={<NotFound />}
    ></Route>
  )
);

export default App;
